import './../style/Counter.css'

function Counter(props) {
    return (
        <div className='counter'>
        <button style={{height: '20px',width: '50px',backgroundColor:'black',color:'white',borderRadius: '5%'}}>-</button>
        <span>{props.count}</span>
        <button style={{backgroundColor:'black',color:'white',borderRadius: '5%'}}>+</button>
        </div>
    );
}

Counter.defaultProps = {
    count: 0
}
export default Counter
